IF OBJECT_ID('dbo.proc_transform_275', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_275;
GO
CREATE PROCEDURE dbo.proc_transform_275
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_275
    SET payload = LEFT(payload, 1000) + N'|V4-275|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_275;
END
